def extract_hexadecimal(input_string):
    pattern = r'^([0-9a-fA-F]{2}[-:]){5}[0-9a-fA-F]{2}$'
    if re.match(pattern, input_string):
        return input_string.upper().replace('-', ':')
    else:
        return None

